objects.startCode:
me.tId = 0
me.shake=false
me.hasKey=false
me.targetX = me.x
me.targetY = me.y
me.previousX = me.x
me.previousY = me.y
goLeft = function (me,dis){
  if(place_free(-1, me.x-30-dis, me.y-30, 60,60, tiles)){
    me.targetX-=dis
    return true
  }else{
    return false
  }
}
goRight = function (me,dis){
  if(place_free(-1, me.x-30+dis, me.y-30, 60,60, tiles)){
    me.targetX+=dis
    return true
  }else{
    return false
  }
}
goDown = function (me,dis){
  if(place_free(-1, me.x-30, me.y-30+dis, 60,60, tiles)){
    me.targetY+=dis
    return true
  }else{
    return false
  }
}
goUp = function (me,dis){
  if(place_free(-1, me.x-30, me.y-30-dis, 60,60, tiles)){
    me.targetY-=dis
    return true
  }else{
    return false;
  }
}

hit_there = function (other,x,y){

  if(other!=null && point_distance(x,y,other.x,other.y)<32){
    return true
  }else{
    return false
  }
}

ob_at = function(map_x,map_y){
  let name = 'none'
  objects.forEach(function(obj) {
    let mx = (obj.x/gridSize).toFixed(1)
    let my = (obj.y/gridSize).toFixed(1)
    if(mx==map_x && my==map_y){
      name = obj.name
    }
  });
  return name
}
ob_type = function(type){
  let matches = []
  objects.forEach(function(obj) {
    if(obj.type==type){
      matches.push(obj)
    }
  });
  return matches
}
all_type = function(type,call_back){
  ob_type(type).forEach(function(obj) {
    call_back(obj)
  });

}
spawnTimer = function(fuse,callback){
  let temp = {
    name:makeName(),
    tId:0,
    kill:false,
    callback:callback,
    endTime:performance.now()+fuse,
    startCode:'',
  loopCode:`me.x=ob('player').x;me.y=ob('player').y;if(performance.now()>me.endTime){me.callback();me.kill=true}`,
    drawCode:'',
  }
  objects.push(temp);

};

objects.loopCode:
me.speed = 64
me.previousX = me.targetX
me.previousY = me.targetY
////////////////////////////////////////////////////
//refigures mapX and mapY from me.targerts for accuracy
me.mapX = (me.targetX/gridSize).toFixed(1)
me.mapY = (me.targetY/gridSize).toFixed(1)
////////////////////////////////////////////////////
//gets up down left right neighbor objects if any
me.oLeft=null;me.oRight=null;me.oUp=null;me.oDown=null
if(ob_at(parseFloat(me.mapX)-1,me.mapY)!='none'){
  me.oLeft = ob(ob_at(parseFloat(me.mapX)-1,me.mapY))
}
if(ob_at(parseFloat(me.mapX)+1,me.mapY)!='none'){
  me.oRight = ob(ob_at(parseFloat(me.mapX)+1,me.mapY))
}
if(ob_at(me.mapX,parseFloat(me.mapY)-1)!='none'){
  me.oUp = ob(ob_at(me.mapX,parseFloat(me.mapY)-1))
}
if(ob_at(me.mapX,parseFloat(me.mapY)+1)!='none'){
  me.oDown = ob(ob_at(me.mapX,parseFloat(me.mapY)+1))
}
/////////////////////////////////////////////////////////
if(keyboard_check_pressed(vk_left)){
  if(me.oLeft!=null){
    if(me.oLeft.type=='gold_key'){
      me.oLeft.kill=true;
      me.hasKey=true;
    }
    if(me.oLeft.type=='locked_door'){
      if(me.hasKey==true){
        me.oLeft.kill=true;
        me.hasKey=false;
      }else{
        me.oLeft.shake=true
        me.oLeft.shaken()
      }
    }
    if(me.oLeft.type=='slider'){
      if(goLeft(me.oLeft,me.speed)){
        tiles[me.oLeft.mapY-0.5][me.oLeft.mapX-0.5]=-1
        tiles[me.oLeft.mapY-0.5][me.oLeft.mapX-1.5]=me.oLeft.tId
      }
    }else{
      goLeft(me,me.speed)
    }
  }else{
    goLeft(me,me.speed)
  }
}
if(keyboard_check_pressed(vk_right)){
