me.x=easeIn(me.x, me.targetX, 0.5)
me.y=easeIn(me.y, me.targetY, 0.5)
view_follow(me,0.4,0.4)

let pressure = false
if(point_distance(me.x,me.y,ob('player').x,ob('player').y)<32){
  pressure=true
}
all_type('slider',function(obj){
  if(point_distance(me.x,me.y,obj.x,obj.y)<32){
    pressure=true
  }

});

if(pressure){
  ob('pressure_door').tId=-1
  me.tId=-1
}else{
  ob('pressure_door').tId=38
  me.tId=127
}
